import styled from "styled-components";

export const StyledFooter = styled.div`
    position: absolute;
    bottom: 0;
    color: #1c1c1c;
    margin-bottom: 12px;
`;

export const StyledFooterLink = styled.a`
    color: #0a0a0a;
    text-decoration: none;
`;
